import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import Typed from "typed.js";
import VanillaTilt from "vanilla-tilt";
import "./App.css";

function App() {
  useEffect(() => {
    // AOS initialization
    AOS.init({
      duration: 800,
      offset: 150,
    });

    // Typed.js initialization
    var typed = new Typed(".auto-type", {
      strings: ["Student", "Third Year College Student From BSIS-NS3A"],
      typeSpeed: 100,
      backSpeed: 60,
      loop: true,
    });

    // Sidebar functionality
    const navMenu = document.getElementById("sidebar");
    const navToggle = document.getElementById("nav-toggle");
    const navClose = document.getElementById("nav-close");

    if (navToggle) {
      navToggle.addEventListener("click", () => {
        navMenu.classList.add("show-sidebar");
      });
    }

    if (navClose) {
      navClose.addEventListener("click", () => {
        navMenu.classList.remove("show-sidebar");
      });
    }

    // VanillaTilt initialization
    VanillaTilt.init(document.querySelectorAll(".Interest-box"), {
      max: 25,
      speed: 400,
    });

    // Clean up VanillaTilt on component unmount
    return () => {
      VanillaTilt.destroy();
    };
  }, []); // Empty dependency array to ensure the effect runs only once on mount

  return (
    // Your JSX structure remains unchanged
    <div>
      {/* ... (Your existing JSX structure) */}
    </div>
  );
}

export default App;
